(118, 1, NULL, 'Section', 'Review', 'review_section_desc_fa_review', 'If you have Facebook reviews, you can add them here.\nReviews are very important on the Coachsome platform, as you have an unique opportunity to build trust with your customers. Through our smart feature, you can transfer your Facebook reviews.\nWith reviews on your profile you are prioritized in our search results. In order to load your Facebook reviews and recommendations, you must click yes to \'manage your pages\' and \'view a list of the pages you manage\'. Coachsome only receives access to read your page\'s posts, reviews & comments. We cannot change or add content on your site.', 'Hvis du har anmeldelser fra Facebook, kan du tilføje dem her.\nAnmeldelser er enormt vigtige på Coachsome-platformen. Du har en unik mulighed for at skille dig ud fra mængden. Via vores smarte funktion, kan du overføre dine Facebook anmeldelser.\nMed anmeldelser på din profil opprioriteres du i vores søgeresultater. For at kunne indlæse dine Facebook anmeldelser og anbefalinger, skal du klikke ja til ‘administrere dine sider’ og ‘vis en liste over de sider du administrerer’. Coachsome modtager kun adgang til at læse din sides indlæg, anmeldelser & kommentarer. Vi kan ikke ændre eller tilføje indhold på din side.', '2019-12-10 05:45:20', '2019-12-10 07:54:10'),
